script: |
  super -f text -I q8848.spq | sort > q8848.out

inputs:
  - name: q8848.spq
    data: |
      SELECT DISTINCT - - col1 * + cor0.col2 + - col1 - + ( - 92 * cor0.col2 ) AS col1 FROM tab1 (FORMAT parquet) AS cor0;
  - name: tab1

outputs:
  - name: q8848.out
    data: |
      10067
      5804
      6346
